using Quilti.DAL;
using Quilti.Models;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace Quilti
{
    public static class DbDataInit
    {
        public static void Init(QuiltiContext context)
        {
            var rowCount = context.Patches.Count();
            if (rowCount == 0)
            {
                var newPatch = new Patch()
                {
                    PatchId = "0x0",
                    X = 0,
                    Y = 0,
                    CreatorIp = "::1",
                    ImageMini = "data:image/jpeg;base64,"
                };
                context.Patches.Add(newPatch);
                context.SaveChanges();

                var newPatchImage = new PatchImage()
                {
                    PatchId = "0x0",
                    Image = "data:image/jpeg;base64,"
                };
                context.PatchImages.Add(newPatchImage);
                context.SaveChanges();
            }
        }
    }
}
